import React from "react";
import { getAllPosts } from "../api";


const Posts = (props) => {
    console.log('in post', {props});
    return (
        <div>
            <h1>Posts</h1>
            {
                getAllPosts.map(post => <div post={post.id}>
                    <h3>{post.title}</h3>
                    <div>{post.body}</div>
                </div>)
            }
        </div>
    )
}

export default Posts;
